import React, {useState, useEffect} from 'react';
import Head from 'next/head'
import Layout from '../components/layout/layout'
import Input from '../components/input/input'
import Card from '../components/card/card'
import Button from '../components/button/button'

const mockAddresses = [
  {
    "line1": "Massachusetts Hall",
    "city": "Cambridge",
    "state": "MA",
    "zip": "02138"
  },
  {
    "line1": "3400 N. Charles St.",
    "city": "Baltimore",
    "state": "MD",
    "zip": "21218"
  },
  {
    "line1": "Roosevelt Way NE",
    "city": "Seattle",
    "state": "WA",
    "zip": "98115"
  },
  {
    "line1": "1600 Holloway Ave",
    "city": "San Francisco",
    "state": "CA",
    "zip": "94132"
  },
  {
    "line1": "1600 Holloway Ave",
    "line2": "Suite 10",
    "city": "San Francisco",
    "state": "CA",
    "zip": "94132"
  },
  {
    "line1": "1600 Holloway Ave",
    "line2": "Suite 20",
    "city": "San Francisco",
    "state": "CA",
    "zip": "94132"
  },
  {
    "line1": "500 S State St",
    "city": "Ann Arbor",
    "state": "MI",
    "zip": "48109"
  },
  {
    "line1": "185 Berry St",
    "line2": "Suite 6100",
    "city": "San Francisco",
    "state": "CA",
    "zip": "94107"
  }
]


export default function Home( {} ) {

  let [addresses, setAddresses] = useState(mockAddresses)
  // useEffect(() => {
  //   fetch("./addresses.json")
  //   .then(response => response.json())
  //   .then(data => setUserAddress(data.message))
  // },[])
  return (
    <Layout home>
      <Head>
        <title>Address Book</title>
      </Head>
      <h1 className="mb-8">Address Book</h1>
      <div className="w-full md:w-1/2">
        <Input
          icon="icon-search.svg"
          label="HELLO"
        ></Input>
      </div>
      <div className="mt-10">
      <Card editState={false} addState={true}>
          <p className="text-lg">Add a new user's address</p>
      </Card>
      {addresses.map(address => 
        <Card address={address}>
          <p>
            {address.line1}, {address.city}, {address.state} {address.zip}
          </p>
        </Card>
      )}
        <Card editState={true}>
          <p>Harry Lobster</p>
          <p>185 Berry St #6100, San Francisco, CA 94107</p>
        </Card>
      </div>
    </Layout>
  )
}
